  false,\n\t\"url\": null,\n\t\"notes\": \"This report on the Santa Clara County wetlands
  was written just prior to the establishment of the San Francisco Bay National Wildlife
  Refuge.  The report summarizes basic wetland ecology and describes the Santa Clara
  baylands.  A number of recommendations for preserving the Santa Clara wetlands are
  made in this report, one of which is to include the Alviso Unit into the proposed
  Federal Wildlife Refuge.  Appendices include information about major marshes, estuaries,
  and lagoons in California; reports on bird populations; and a report from the National
  Estuary Study.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
